package de.fivethree.immoapps.backend.model.payload.res.user;

import java.util.List;

public class GetUsersOfHausverwalterResponse {
    private List<GetUserResponse> users;
    private List<GetUserResponse> mitarbeiter;

    public GetUsersOfHausverwalterResponse(List<GetUserResponse> users, List<GetUserResponse> mitarbeiter) {
        this.users = users;
        this.mitarbeiter = mitarbeiter;
    }

    public List<GetUserResponse> getUsers() {
        return users;
    }

    public void setUsers(List<GetUserResponse> users) {
        this.users = users;
    }

    public List<GetUserResponse> getMitarbeiter() {
        return mitarbeiter;
    }

    public void setMitarbeiter(List<GetUserResponse> mitarbeiter) {
        this.mitarbeiter = mitarbeiter;
    }
}
